tables.table_schema:
CREATE TABLE land_ownership (
    id INT PRIMARY KEY,
    owner_name VARCHAR(100),
    property_address VARCHAR(255),
    area DECIMAL(10, 2)
);

CREATE TABLE property_ownership (
    id INT PRIMARY KEY,
    property_type VARCHAR(50),
    owner_id INT REFERENCES land_ownership(id),
    purchase_date DATE
);

CREATE TABLE planning_projects (
    project_id INT PRIMARY KEY,
    project_name VARCHAR(100),
    start_date DATE,
    end_date DATE,
    project_status VARCHAR(20)
);

CREATE TABLE PropertyOwners (
    owner_id INT PRIMARY KEY,
    owner_name TEXT,
    contact_number TEXT
);

CREATE TABLE LandParcel (
    parcel_id INT PRIMARY KEY,
    parcel_size FLOAT,
    address TEXT
);

CREATE TABLE PropertyTransactions (
    transaction_id INT PRIMARY KEY,
    property_id INT,
    transaction_date DATE,
    amount DECIMAL
);

CREATE TABLE UrbanDevelopments (
    project_id INT PRIMARY KEY,
    project_name TEXT,
    location TEXT,
    development_cost DECIMAL
);
